import { Col, Button, Row, Container, Card, Form } from "react-bootstrap";
export default function Home() {
  return (
    <Container>
   <div class="Hero--Content-wrapper css-7anjg0 e18ar5lu0"><p>Conserve and sustainably use the oceans, seas and marine resources for sustainable development.</p><div class="css-1tfcj1x e18ar5lu3"><div class="Text Text--adaptive"><span class="Text-largeLink"><svg width="20" height="20" viewBox="0 0 20 20" class="Text-icon"><g transform="rotate(90 10 10)" fill="none" fill-rule="evenodd"><path d="M11.52 10L8 13.52l.73.73L12.98 10 8.73 5.75 8 6.48 11.52 10z" fill="currentColor"></path><circle stroke="currentColor" cx="10" cy="10" r="9.5"></circle></g></svg>Find out more</span></div></div></div>
  </Container>
  )
}
